The Aircraft Communications Addressing and Reporting System (ACARS) is managed by Aeronautical Radio, Inc., (ARINC) and is used by airlines to transmit a variety of proprietary air-to-ground communications. NOAA&#8217;s Forecast Systems Laboratory (FSL) uses the term ACARS to designate automated weather reports from commercial aircraft. These data are routed by several cooperating airlines to FSL, who decode and quality-control the data. <strong>Data for this instrument are no longer being collected by ARM; however, current data are available at the <a href='http://madis.noaa.gov/'>MADIS archive</a>.</strong>
